import React from 'react';
import Word from "./Word/Word";
import GetAllWord from "../../components/DataDB/DataDB";


function WordList(props) {
    let arr = [];
    function renderWord() {
        GetAllWord().then(value => {
            //let arr = [];
            for (let i = 0; i < value.length; i ++){
                arr.push(
                    <Word
                        key={value[i].id}
                        word={value[i].word}
                        translation={value[i].translation}
                    />)
            }
            // value.forEach(item => {
            //
            // });

        }).then(() => {return arr});
    }


    return (
        <div>
            <button onClick={console.log(renderWord())}>x</button>
            {arr}
        </div>
    );
}

export default WordList;
